/**
 * Constructor
 */
inline Hihat::Hihat(){ 
  this->player = new AudioPlayPitchedMemory();
//  this->player->frequency(100); 
  
  this->output = new AudioMixer4();
  this->output->gain(0, 0.15);

  this->patchCords[0] = new AudioConnection(*this->player, 0, *this->output, 0);
}

/**
 * Return the audio output
 */
inline AudioMixer4 * Hihat::getOutput(){
  return this->output;
}

/**
 * Note on
 */
inline void Hihat::noteOn(bool open) {
  if(open){
    this->player->play(this->openHiHatSample, 23360);
  }else{
    this->player->play(this->closedHiHatSample, 4992);
  }
}

